import React from 'react';
import { Container, Grid, Card, CardContent, CardActions, Button, Typography, Box } from '@mui/material';
import { makeStyles } from '@mui/styles'; // Change this to import { makeStyles } from '@mui/material/styles';
import { AccessTime, Comment } from '@mui/icons-material';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    padding: theme.spacing(4),
  },
  card: {
    maxWidth: 345,
    margin: theme.spacing(2),
  },
  media: {
    height: 140,
  },
  icon: {
    verticalAlign: 'middle',
    marginRight: theme.spacing(1),
  },
  footer: {
    marginTop: theme.spacing(4),
    padding: theme.spacing(4),
    backgroundColor: theme.palette.grey[200],
  },
  footerLinks: {
    display: 'flex',
    justifyContent: 'space-between',
  },
  footerLinkSection: {
    display: 'flex',
    flexDirection: 'column',
  },
  footerText: {
    marginTop: theme.spacing(2),
  },
}));

const BlogCard = ({ blog }) => {
  const classes = useStyles();

  return (
    <Card className={classes.card}>
      <CardContent>
        <Typography variant="h6" gutterBottom>
          {blog.title}
        </Typography>
        <Typography variant="body2" color="textSecondary" component="p">
          {blog.content}
        </Typography>
        <Box mt={2}>
          <Typography variant="body2" color="textSecondary">
            <AccessTime className={classes.icon} />
            {blog.time}
          </Typography>
          <Typography variant="body2" color="textSecondary">
            <Comment className={classes.icon} />
            {blog.comments}
          </Typography>
        </Box>
      </CardContent>
      <CardActions>
        <Button size="small" color="primary">
          Read
        </Button>
      </CardActions>
    </Card>
  );
};

const Blogs = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Container>
        <Typography variant="h4" align="center" gutterBottom>
          Blogs
        </Typography>
        <Grid container spacing={3}>
          {blogs.map((blog, index) => (
            <Grid item xs={12} sm={6} md={4} key={index}>
              <BlogCard blog={blog} />
            </Grid>
          ))}
        </Grid>
      </Container>
      <Box className={classes.footer}>
        <Container className={classes.footerLinks}>
          <Box className={classes.footerLinkSection}>
            <Typography variant="body1" gutterBottom>
              Our Services
            </Typography>
            <Typography variant="body2" color="textSecondary">IOT Development</Typography>
            <Typography variant="body2" color="textSecondary">Mobile Development</Typography>
            <Typography variant="body2" color="textSecondary">Enterprise Solutions</Typography>
            <Typography variant="body2" color="textSecondary">Blockchain Development</Typography>
          </Box>
          <Box className={classes.footerLinkSection}>
            <Typography variant="body1" gutterBottom>
              Quick Links
            </Typography>
            <Typography variant="body2" color="textSecondary">Home</Typography>
            <Typography variant="body2" color="textSecondary">About Us</Typography>
            <Typography variant="body2" color="textSecondary">Services</Typography>
            <Typography variant="body2" color="textSecondary">Contact Us</Typography>
          </Box>
          <Box className={classes.footerLinkSection}>
            <Typography variant="body1" gutterBottom>
              Contact Us
            </Typography>
            <Typography variant="body2" color="textSecondary">+44 79 155 119 88</Typography>
            <Typography variant="body2" color="textSecondary">+34 693 84 55 46</Typography>
            <Typography variant="body2" color="textSecondary">info@lyxux.com</Typography>
            <Typography variant="body2" color="textSecondary">London, United Kingdom</Typography>
          </Box>
        </Container>
        <Container>
          <Typography variant="body2" color="textSecondary" align="center" className={classes.footerText}>
            © 2024 LYXUX LTD. All rights reserved.
          </Typography>
        </Container>
      </Box>
    </div>
  );
};

export default Blogs;
